import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/hello">
      <a style={linkStyle}>Hello</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/shows">
      <a style={linkStyle}>Shows</a>
    </Link>
    <style jsx>{`
    a {
      color: red
    }
  `}</style>
</div>
)

export default Header;
